import './cart.styles.scss';
import { ReactComponent as ShoppingIcon} from '../../shopping-bag.svg';

const Cart = () => (
	<div className = 'cart-icon'>
		<ShoppingIcon className = 'shopping-icon' />
		<span className = 'item-count'>0</span>
	</div>	
)

export default Cart;
